import { useParams } from "react-router-dom"
import { Card,Container,Image } from "react-bootstrap"
import NavHeader from './navbar'
// import logo from '../.png'




function Payment({data}){
    const params = useParams()
    return(
        <>
            <NavHeader/>
            {data.filter((list) => list.id == params.id).map((list) => (
            <Container>
            <Card style={{margin:'90px', padding:'20px'}}>
            {/* <Card.Header className="border border-opacity-10">Quote</Card.Header> */}
            <Image src="../../images/icon-payment.png" width="250px"/>
                <Card.Body className="pt-2">
                  <div>
                    <h4 className="fw-semibold">{list.tittle}</h4>
                    <span className="text-secondary">{list.city}</span>
                  </div>
                </Card.Body>
            </Card>
            </Container>
            ))}
        </>
    )
}

export default Payment
